 */
const Milestone = createLucideIcon('Milestone', [
  [
    'path',
    {
      d: 'M18 6H5a2 2 0 0 0-2 2v3a2 2 0 0 0 2 2h13l4-3.5L18 6Z',
      key: '1mp5s7',
